import React from "react";
import { makeStyles } from "@mui/styles";
import Typography from "@mui/material/Typography";

const useStyle = makeStyles((theme) => ({
  gardent01: {
    background:
      "linear-gradient(29deg, rgba(2,0,36,1) 24%, rgba(69,4,88,1) 71%, rgba(62,57,184,1) 100%)",
  },
  flexCenter: {
    display: "flex",
    justifyContent: "center",
    alignItems: "center",
  },
  flexCenterColumn: {
    display: "flex",
    justifyContent: "center",
    alignItems: "center",
    flexDirection: "column",
  },
}));

const Pricing = () => {
  const classes = useStyle();
  return (
    <>
      <div
        className={`${classes.gardent01} ${classes.flexCenterColumn}`}
        style={{ width: "100vw", minHeight: "100vh" }}
      >
        <Typography variant="h1" color="white">
          Pricing
        </Typography>
        <hr style={{ width: "80vw" }} />
        <br />
        <br />
        <br />
        <br />
        <Typography variant="" color="initial">
          <br />
          <br />
          fullstack: Advance app anf functionalty: US$ 2000
        </Typography>
      </div>
    </>
  );
};

export default Pricing;
